import { useState, useEffect } from 'react';
import MoviesContainer from './MoviesContainer';

const Top250 = () => {
  const [top250, setTop250] = useState(null);
  const apiEndPoint = process.env.REACT_APP_TOP250_END_POINT;
  const apiKey = process.env.REACT_APP_API_KEY;

  useEffect(() => {
    const fetchTop250 = async () => {
      const res = await fetch(`${apiEndPoint}api_key=${apiKey}`);
      const data = await res.json();
      console.log('data:', data);
    };
    fetchTop250();
  }, []);
  return (
    <div className='container'>
      <h2 className='top250-header'>Top Rated Movies</h2>
      {/* <MoviesContainer />; */}
    </div>
  );
};

